INSERT INTO `speech` (`id`, `speech_person`, `speech_speech`, `speech_path`, `speech_date`) VALUES
(1, 'principal', '<p>A Few Introductory Words from the Desk of Principal. Border Guard Public School &amp; College, Sylhet, an ideal educational institution, directly patronized by the BGB Sylhet sector is situated in the holy city of Sylhet at BGB Sector Akhalia, Sylhet. It is an untarnished institution that is secured, tuneless, covered with green trees, and charm. It is a unique institution of acquiring proper knowledge and advanced teaching method which build up ideal human beings. It started its journey in the ocean of education in the year of 1993 after the name of its patronizing organization, Bangladesh Rifles High School, Sylhet and recognized as a secondary school in 1996. The first batch appeared at SSC in 1997. On the way of its ongoing march, the institution upgraded as an intermediate college in 2012 maintaining all formalities set by the Ministry of Education, BISE Sylhet, and it gets the fullest moon by appearing its first batch at HSC Exam in 2014.<br />It is regarded as one of the best institutions due to its discipline, teaching technique, and a favorable teaching environment. In the meantime, BGPSC has achieved name and fame due to cent percent successful results in all public exams and has acquired a position in the top 20 of the Sylhet education board. It keeps its advancement by maintaining a specific target, short term (weekly) medium-term (monthly) and long term etc.<br />The students of the institution take part actively and successfully in the programs organized by Government and local authorities.<br />Reverent Sector Commander is the chairman of the Governing Body (ex &ndash;officio).<br />In all respects, considering overall activities the institution is one of the best in the Sylhet division as well as all over Bangladesh.<br />We are committed and determined to uphold this prestigious institution in a sky-catching position through co-operation from all strata of people.<br /><br />May Allah help us. operator<br /><br />Thanks to all.<br />Md. Fayzul Haque<br />Principal<br />Border Guard Public School &amp; College, Sylhet.</p>', 'public/speech/principal11.jpeg', '2020-06-02'),
(3, 'president', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n<p>Col MAHMUD MAWLA DON, afwc, psc<br />Deputy Director General<br />Sector Commander<br />BGB, Sector Headquarters, Sylhet.</p>', 'public/speech/president78.jpg', '2020-06-02'),
(4, 'gb_member', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n<p>Lt Col Ahmed Yusuf Jamil (PSC)<br />Commander,48 BGB Sylhet</p>', 'public/speech/gb_member92.jpg', '2020-06-01');
